('S20132F1A090022', '20132', 'F1A090022', NULL, '', '<p>Pendekatan Grup LIE Melalui Grup Matriks LIE</p>', '<p>Grup Lie digunakan sebagai alat untuk menyelesaikan atau menyederhanakan persamaan diferensial parsial. Dalam skripsi ini, kita meneliti grup Lie melalui pendekatan grup matriks Lie dan lebih jauh kita membuktikan bahwa&nbsp; setiap grup matriks Lie adalah grup Lie.</p>', '<p><em>Lie groups were initially introduced as a tool to solve or simplify ordinary and partial differential equations. In this final project, we investigate a Lie group through a matrix Lie group and then we prove that each matrix Lie group is Lie group.</em></p>', '2014-08-30', 0, '2014-02-22', 'B20132F1A090022', '0411057607', '0403067801', '2015-12-04'),
('S20132F1A090004', '20132', 'F1A090004', NULL, '', '<p>Analisis Antrian Pelayanan Pasien Dengan Satu <em>Server</em> Di Puskesmas Pangalengan</p>', '<p>Penelitian ini dilakukan untuk mengetahui antrian pelayanan pasien pada Puskesmas Pangalengan. Pengumpulan data dilakukan secara langsung pada Puskesmas Pangalengan selama 2 hari, selama 4 jam waktu pengamatan tiap harinya. Model antrian yang digunakan adalah (M/M/1) :(FCFS/~/~), tingkat kedatangan bersebaran poison, waktu pelayanan bersebaran eksponensial, dengan jumlah pelayanan adalah seorang dokter, disiplin antrian yang digunakan adalah pasien yang pertama datang yang pertama dilayani, jumlah pelayanan dalam sistem dan ukuran populasi pada sumber masukan adalah tak berhingga. Sistem antrian di puskesmas dengan laju kedatangan 8 pasien dan laju pelayanan 9 pasien. Terlihat bahwa dokter sibuk yaitu dengan prosentase 87%. Sehingga presentase dokter menganggur cukup kecil yaitu 13%. Ukuran sistem antrian di Puskesmas Pelanggan tersebut adalah&nbsp;<span class="math-tex">\\({L_s}\\)</span>= 7 Pasien, <span class="math-tex">\\(L_q\\)</span> = 6 Pasien <span class="math-tex">\\(W_s\\)</span>= 51,28 menit <span class="math-tex">\\(W_q\\)</span> = 44,61 menit</p>', '<p><span class="math-tex">\\(\\)</span><em>This study was conducted to determine the queue Pangalengan patient care at the health center. Data collection was performed directly on PHC Pangalengan for 2 days, 4 hours each day observation period. The model used is the model queue (M/M/1) : (FCFS/~/~), be spread Poisson arrival rate, service time be spread exponentially, with the number of services is a doctor, the queue discipline used is the patient&#39;s first come first served, number of service in the system and the size of population on the input source is infinite. Queuing system with arrival rate at the healt center patiens and the rate of service 8 of 9 patients. shown that physicians are busy with the percentage 87%. So that is quite a small percentage of doctors unemployed at 13% Size Pengalengan queuing system at the health center is&nbsp;<span class="math-tex">\\(L_s\\)</span> =7 patients,<span class="math-tex">\\(L_q\\)</span> =6 patients<span class="math-tex">\\(W_s\\)</span> =51,28 minutes <span class="math-tex">\\(W_q\\)</span>= 44,61 minutes</em></p>', '2014-08-30', 0, '2014-02-22', 'B20132F1A090004', '0403037403', '0403067801', '2015-12-05'),
('S20132F1A090014', '20132', 'F1A090014', NULL, '', '<p>Peramalan Jumlah Penumpang Kereta Api Menggunakan Metode Dekomposisi Cencus II (Studi Kasus : PT Kereta Api Indonesia dan PT KAI Commuter Jabodetabek)</p>', '<p>Peningkatan jumlah penumpang pada musim liburan menimbulkan masalah penumpukan calon penumpang, kehabisan tiket, dan lain sebagainya. Oleh karena itu, prediksi jumlah penumpang diperlukan oleh pelaku bisnis transportasi. Salah satu metode prediksi yang dapat digunakan adalah metode Dekomposisi Cencus II.</p><p>Dari hasil prediksi jumlah penumpang PT Kereta Api Indonesia dan PT KAI Commuter Jabodetabek untuk priode Januari 2013 sampai Desember 2013, prediksi jumlah penumpang tertinggi terjadi pada bulan Desember, sedangkan prediksi jumlah penumpang terendah terjadi pada bulan Februari.</p>', '<p><em>Increased of the total passengers in the holiday season caused problems of passengers accumulation, run out of tickets, and so forth. Therefore, the prediction of total passengers is required by transportation businesses. One of prediction methode that can be used is Decomposition Cencus II method. </em></p><p><em>From the result of the total passengers prediction of PT Kereta Api Indonesia and PT KAI Commuter Jabodetabek for January 2013 to December 2013 period obtained that the highest of the total passenger was occured on December, while the lowerst of the total passenger was occurred on February</em></p>', '2014-08-30', 0, '2014-02-22', 'B20132F1A090014', '0403037403', '0402108204', '2015-12-04'),
('S20132F1A090005', '20132', 'F1A090005', NULL, '', '<p>Hill Cipher(n,A) Perluasan Kriptografi Hill Cipher</p>', NULL, NULL, '2014-08-30', 0, '2014-02-22', 'B20132F1A090005', '0403037403', '0402108204', '2015-11-29'),
('S20132F1A090019', '20132', 'F1A090019', NULL, '', '<p>Model Penyimpanan Dan Pengambilan Tabungan Rencana Berdasarkan Tingkat Suku Bunga Dan Priode Pengambilan Menggunakan Anuitas</p>', NULL, NULL, '2014-08-30', 0, '2014-02-22', 'B20132F1A090019', '0404037103', '0402108204', '2015-11-29'),
('S20132F1A100006', '20132', 'F1A100006', NULL, '', '<p>Model Regresi Linear Berganda Untuk Menganalisis Faktor-Faktor Yang Mempengaruhi Jumlah Produksi Susu Sapi Perah di Unit Produksi SMK Negeri 5 Pangalengan</p>', '<p>Konsumsi susu masyarakat indonesia masih rendah dibandingkan dengan negara lain, padahal susu bermanfaat untuk meningkatkan kecerdasan. Untuk memenuhi kebutuhan tersebut, maka susu harus senantiasa tersedia di berbagai daerah Indonesia. Oleh karena itu, tingkat produksi susu sapi perah yang tinggi dari para peternak merupakan landasan bagi pembangunan budaya mengkonsumsi susu nasional.</p><p>Penelitian ini dilakukan dengan tujuan untuk mengetahui model hubungan dan besarnya pengaruh antara jumlah pakan hijauan, jumlah pakan konsentra, biaya sarana prasarana dan jumlah siswa yang piket sebagai variabel independen terhadap jumlah produksi susu sebagai variabel dependen di Unit Produksi SMK Negeri 5 Pangalengan. Data yang diperoleh dianalisis dengan menggunakan analisis regresi linier berganda dengan analisis korelasi yang dapat memberikan besaran mengenai pengaruh atau hubungan antara variabel-variabel tersebut.</p><p>Berdasarkan hasil analisis dalam penelitian ini, hasil pengujian asumsi klasik menunjukan model regresi dalam penelitian ini memenuhi asumsi klasik model regresi linier berganda. Dari model regresi yang diperoleh, menunjukan bahwa setiap variabel independen memberikan pengaruh positif terhadap variabel dependen. Hasil pengujian hipotesis dengan tingkat keyakinan 95% menunjukan antara variabel-variabel independen baik secara simultan (Uji F) maupun secara parsial (Uji t) memiliki pengaruh signifikan terhadap variabel dependen. Hasil analisis korelasi untuk masing-masing variabel independen menunjukan adanya korelasi/hubungan yang tinggi terhadap variabel dependen. Selanjutnya, nilai koefisien penentu menunjukan semua variabel independen memberikan sumbangan pengaruh yang besar terhadap jumlah produksi susu.</p>', '<p><em>Dringking milk of Indonesian&#39;s pepole still low just than other countries, but milk can improve intelligence. To fulfill these needs, milk must be available in various region in Indonesia. Because of it, the high improvement of milk production from the farmer is the importan foundation of culture building of national milk consumption.</em></p><p><em>This research was conducted to determine the correlation model and the influence of the amount of forage, the amount of concentrate feed, the cost of infrastructure and the number of students who picket as the independent variabels on the amount of milk production as the dependent variabel in the production unit of SMK Negeri 5 Pengalengan. Data were analyzed using multiple linear regression analysis is able to provide the amount of influence or relationnship between these variabels.</em></p><p><em>Based on analysis of this research, the test result showed the assumption of classical regression models in this research met the assumptions of classical linear regression model. Based on the regression model showed each independent variables give the positive influence on the dependent variable. The results of hypothesis testing with level of significant 95% showed between the independent variabels either simultaneously (F test) or partially (t test) have a significant influence on the dependent variable. The results of the correlation analysis for each of the independent variabels showed a high correlation to the dependent variabel. Then, the value of coeffient determinant showed all of the independent variabels contributed influence significanly on the dependent variabel &nbsp; &nbsp; </em></p>', '2014-08-30', 0, '2014-02-22', 'B20132F1A100006', '0404037103', '0403067801', '2015-12-03'),
('S20132F1A100002', '20132', 'F1A100002', NULL, '', '<p>Analisis Trend Dengan Metode Kuadrat Terkecil Pada Peramalan Jumlah Produksi Roving Bobbin di PT. Kampung Harapan Plastik</p>', NULL, NULL, '2014-08-30', 0, '2014-02-22', 'B20132F1A100002', '0404037103', '0403067801', '2015-11-29'),
('S20132F1A090012', '20132', 'F1A090012', NULL, '', '<p>Modifikasi Affine Cipher dan Vigenere Cipher Dengan Menggunakan n Bit</p>', '<p><em>Affine cipher</em> dan <em>vigenere cipher </em>merupakan kriptografi klasik yang memeiliki kunci yang simetrik, dengan menggunakan alfabet 26 huruf, sehingga kedua metode ini memiliki banyak kekurangan, disamping itu pula komputer menggunakan kode ASCII yang tidak hanya berupa alfabet saja melainkan angka, simbol dan kode-kode. Skripsi ini membahas modifikasi <em>Affine Chipher</em> dan <em>vigenere cipher</em> dengan menggunakan n bit, dimana untuk proses enkripsi dan deskripsi karakter diubah ke dalam bentuk kode ASCII desimal 256 dan selanjutya di ubah ke biner dengan menggunakan modulo&nbsp;<span class="math-tex">\\(2^n\\)</span> &nbsp;</p>', '<p><em>Affine chiper and Vigenere cipher is a crypographic cipher classic that has a simmetric key, by using a 26 letter alphabet, so that both method have many short coming, besides that computers use ASCII to does not only in the form of the alphabet, but both numbers, symbols and codes. This paper discusses the modification affine chiper and vigenere chiper using n bits, where to process the encryption and description in the form of caracter converted to decimal ASCII 256 and then chaged to binary by using modulo&nbsp; <span class="math-tex">\\(2^n\\)</span>&nbsp; </em></p>', '2014-08-30', 0, '2014-02-22', 'B20132F1A090012', '0403037403', '0402108204', '2015-12-04'),
('S20122F1A080004', '20122', 'F1A080004', NULL, '', '<p>Aplikasi Model Antrian (M/M/C):(GD/&infin;/&infin;) Pada Teller Bank</p>', '<p>Pelayanan bank yang sangat diraakn oleh masyarakt adalah pelayanan teller, yang kadang-kdang terjadi antrian panjang. Di dalam kripsi ini, akan digunakan model antrian multi chnnel single phase (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>)</em> untuk mengetahui kinerja sitem antrian pda pelayann teller Bank Centrl Aia KCU Ahmad Yni. Dengan obrevi pada Bank yang bersangkutan, kemudian data diolah dengan menggunakan Microsoft Excel. Data yang diambil adalah jumlah kedatangan naabah per satuan waktu, sampel rata-rata waktu pelayanan teller pada tiap naabah.</p><p>Data dianalisis dengan menggunakan model antrian multi channel ingle phase (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>) sehingga akan diketahui kinerja sistem antrian tersebut. Parameter yang diukur adalah tingkat utilisasi, probabilitas terdapat 0 orang dalam sistem, peluang masa sibuk, ekspektasi panjang garis, ekspektasi panjang antrian, ekspektasi waktu menunggu dalam sistem dan ekspektasi waktu menunggu dalam antrian.</em></p><p><em>Dari hasil analisis dengan model antrian multi channel ingle phase </em> (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span></em>), kinerja sistem antrian pada PT. Bank Central Asia KCU Ahmad Yano Cicadas BAndung sudah baik, kareba waktu terpanjang yang dibutuhkan seorang nasabah dalam antrian hanya 4,60 menit. Antrian terpanjang hanya sebanyak 6,35 orang, terjadi pada hari Senin karena merupakan awal pekan. Perbandingan antar laju kedatangan nasabah pratuan waktu sudah optimal karena rata-rata kedatangan nasabah yang paling banyak terjadi pada hari senin, yaitu 82,8 nasabah/jam dan rata-rata pelayanan, yaitu 91,8 nasabah/jam, hal ini menunjukkan rata-rata pelayanan lebih bear daripada kedatangan.</p><p>&nbsp;</p><p><strong>Kata kunci: </strong>Model antrian, pelayanan, waktu tunggu, multi channel single phase (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>)</em></p>', '<p><em>The bank service wihich is often complained by bank custumers is teller service, which is sometime forms a long 1queue of customers. In this undergraduate thesise, it will be used the queuing model multi channel single phase </em> (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>) to investigat the queing perfermance of customer&#39; queue at Bank Central Asia of Ahmad Yani branch. By conducting observation directlyin the bank, the queing system data was recorde and tabulted using Microsoft Excel. The collected queuing data was the sum of customers per unit time and the average of teller service time for each customer.</em></p><p><em>Data was analyzed by using the queuing model multi channel single phase </em> (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>) so that the q1ueuing system perfomance was known. Parameter used were utilization rate, probability that there is 0 (zero) person in the queue, probability of busy time, queue lenght expectation, sytem waiting time ecpectation, and queueing waiting time expectation.</em></p><p><em>The result of the analysi is showed by using the queuing model multi channel single phase </em> (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>) the queuing system performance at Bank Central Asia of Ahmad Yani Cicadas Bandung was satisfactory as the longest time spent by customer was 4.60 miinutes. The longest queue was 63.5 persons which happened on Monday as the first day in the week. The comparison between the cutomers coming arrival rate was on Monday, that i 82.8 customers per hour, and the average service time was 91.8 customers per hour. This show that the average service time was rate was greater than the average customers arrival time rate.</em></p><p>&nbsp;</p><p><em>Key words: The queing model, service, waiting line, multi channel single phase </em> (<em>M/M/C)<span class="math-tex">\\(\\)</span>:</em>(<em>GD/<span class="math-tex">\\(\\infty\\)</span>/<span class="math-tex">\\(\\infty\\)</span>)</em></p>', '2013-07-27', 0, '2013-07-22', 'B20122F1A080004', '0402108204', '0404037103', '2016-01-14'),
('S20122F1A080005', '20122', 'F1A080005', NULL, '', '<p>Metode Simpleks Dalam Mengoptimalkan Asupan Gizi Harian Menggunakan QM For Windows</p>', '<p>Gizi adalah hal penting yang dibutuhkan tubuh. Jenis gizi yang dibutuhkan manusia diantaranya: karbohidrat, lemak, protein, vitamin, dan mineral. Sebagian besar gizi yang dibutuhkan tubuh merupakan unsur yang terkandung dalm makanan, tetapi tidak setiap makanan mempunyai kandungan gizi yang lengkap. sehingga untuk memnuhi kebutuhan gizi, makanan yang diperlukan harus beranekaragam agar asupn gizi terpenuhi. Tingkt pendapatan masyarkt menajadi salah satu faktor yang mempengaruhi asupan gizi tubuh. Dibutuhkan suatu metode untuk dapat memilih jenis makanan yang dapat memnuhi asupan gizi yang dibutuhkan tubuh, tetapi dengan biaya yang dikeluarkan tidak terlalu tinggi.</p><p>Metode simpleks merupakan metode program linier yang dapat digunakan untuk memilih jenis makanan yang dapat memnuhi kebutuhan gizi tubuh. Dan aplikasi QM for Windows adalah salah satu aplikasi komputer yang dapat membantu menghitung nilai optimum suatu persoalan program linier.</p><p>&nbsp;</p><p><strong>Kata kunci:</strong></p><p>Asupan gizi, Biaya minimum<strong>, </strong><em>Metode Simpleks, QM for Windows.</em></p>', '<p><em>Nutrition is importan that the human body needs. Kinds nutrients that humans need are: carbohydrates, fats, proteins, vitamins, and minerals. Most of the nutrients the body needs is an element contained in the food, but not every food has complete nutrient. So as to meet the nutritional nrrds, necesary food mut be diverse o that nutrition is met. Income levels had becom one of the factors that influence the body&#39; nutritional intake. Need a method to be able to chooe the type of food that can meet the nutrition your body needs, but the cost i nit to high.</em></p><p><em>Simplex method is a linear programming method that can b used to select the type of food that can meer the nutritional needs of the body. and application of QM for Windows is one of the computer applications that can help calculate the optimum value of a linear programming problem.</em></p><p>&nbsp;</p><p><em><strong>Keywords:</strong></em></p><p><em>Nutrient intake, the minimum fee, implex Method, QM for Windows.</em></p>', '2013-07-27', 0, '2013-07-22', 'B20122F1A080005', '0403067801', '0404037103', '2016-01-14'),
('S20131F1A090002', '20131', 'F1A090002', NULL, '', '<p>Implementasi Algoritma Kriptografi RSA Untuk Pengamanan Data Transkrip Akademik Mahasiswa</p>', '<p>Algoritma RSA digunakan pada transkrip akademik mahasiswa karena keamanan yang dimiliki oleh Algoritma RSA lebih handal dibandingkan algoritma kriptografi yang lainnya. Hal ini berdasarkan kunci yang dipakainya, yaitu kunci punlik untuk proses enkripsi dan kunci privat untuk proses dekripsi. Sehingga keamanannya lebih terjamin.</p><p>Implementasi algoritma RSA pada transkrip akademik mahasiswa diterapkan pada file HTML karena langkah yang digunakan untuk proses enkripsi dan deskripsi sesuai dengan karakter file HTML yang bersifat dinamis.</p>', '<p><em>RSA algorithm is used on student&#39;s academic transcripts because of the scurity held by RSA algorithm is more reliable than other cryptographic algorithms. It is based on the key he uses, which is a public key for encryption and a private key for decryption processes. So security is guaranteed.</em></p><p><em>Implementation of the RSA algorithm is applied to the student&#39;s academic transcript HTML files for steps used for encryption and decryption in accordance with the character of dynamic HTML file</em></p>', '2014-02-22', 0, '2014-02-22', 'B20131F1A090002', '0403037403', '0402108204', '2015-12-05'),
('S20131F1A090015', '20131', 'F1A090015', NULL, '', '<p>Penerapan Metode Simpleks Terhadap Optimalisasi Produksi Untuk Memaksimalkan Keuntungan Dengan Menggunakan QM For Windows Pada Ratnasari Bakery</p>', '<p>Produksi adalah kegiatan untuk menciptakan dan menambah kegunaan barang dan jasa. dalam rangka memperoleh keuntungan yang maksimal perlu dilakukan upaya dalam menentukan jumlah kombinasi produksi yang optimal dan memecahkan masalah pengaloksian sumber daya yng terbatas. metode simpleks merupkan metode pemrograman linier yang dapt digunkan untuk menentukn jumlah produksi yang optiml. <em>Software QM for Windows </em>adlh salah satu program komputer yang dapat membantu dalam menyelesaikan persoalan program linier.</p><p>Objek Penelitian dalam penyusunan skripsi ini adalah proses produksi makanan pada Toko Ratnasari Bakery yangberalmt di JL. Ray Banjran - Soreang No. 104. Hasil penelitian dan perhitungan <em>software QM for Windows</em> menyrnkn bhwa perusahaan dapat memperoleh keuntungn maksimal apabila perusahaan memproduksi berdasarkan hasil kombinasi produksi yang optimal. Hal ini diperoleh dari tingkt perbandingan jumlah produksi dan keuntungan dimana hasil perhitungn software QM for Windows menyatakna hasil yang lebih optimal.</p><p>&nbsp;</p><p><strong>Kata kunci:</strong></p><p>Metode Simpleks, <em>QM for Windows,</em> Bahan Baku Utama, Laba.</p>', '<p><em>Production is an activity to creat and add the utility of something. In getting profit maximal it must be done an effort to decide total production combination optimally and to break factors of production allocation probleminade1qutely Simplex method is Linier Program Method tht can be used to determine total production optimally. QM Software for Windows is one of computer programs that can help to solve the problem of Linear Programming.</em></p><p><em>Research object ini composition this paper is processing of food productions in Ratnasari Bakery at Jl. Raya Banjaran-Soreang 104. The research result and calculation QM Software for Windows sugggested that the comp1any will achieve maximal profit if it produces based on production combination result optimally. It i gotten from degree of comparison production reult adn profit where the reult of calculation QM Software for Windows explained get more optimally.</em></p><p>&nbsp;</p><p><em><strong>Key word:</strong></em></p><p><em>Simplex Method, QM for Windows, Firts Basic Material, Profit.</em></p>', '2014-02-22', 0, '2014-02-22', 'B20131F1A090015', '0404037103', '0403067801', '2016-01-14');
